import './Home.css';

import Nav from './Nav.js'
import About from './About';
import EndProgram from './ETE';
import Why from './Why';



function Home() {
  return (
    <div className='head'>
      <Nav/>
      
      <About/>
      <EndProgram/>
      <div className='mains'>
    <Why name="KGF 2" img="/asset/image/kgf.jpg"/>
   <Why name="RRR" img="/asset/image/r.jpg" />
    <Why name="BAHUBALI 2"img="/image/bb.jpg" />

    </div>

    </div>
      
    
      
  )

}

export default Home
